import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import './Login.css';

function Login(props){

    return(
        <div>
            <form className="contact-form row">
            <div className="form-field col-lg-6">
         <input id="userName" className="input-text js-input" type="text" required/>
         <label className="label" for="">User Name</label>
      </div>

      <div className="form-field col-lg-6 ">
         <input id="password" className="input-text js-input" type="password" required/>
         <label className="label" for="company">Password</label>
      </div>
            </form>

        </div>

    );
}
export default Login;
